import Offline from "./Offline";
import {Audio} from "expo-av";
import * as FileSystem from "expo-file-system";

// Generated from AWS Polly to match MP3 format: <speak><break time="1s" /></speak>
// 1ms, 10ms, 100ms, 1s, 10s..
const silences = [
	"",
	"",
	"",
	"",
	"",
];

export default class Sound {

	static async fromBase64(name, base64 = '', initialStatus = {}) {

		const uri = FileSystem.cacheDirectory + name + '.mp3';
		await FileSystem.writeAsStringAsync(uri, base64, {
			encoding: FileSystem.EncodingType.Base64,
		});

		const sound = new Audio.Sound();
		await sound.loadAsync({ uri }, initialStatus);

		return sound;
	}

	static async getAudio(filename) {
		const uri = FileSystem.cacheDirectory + filename;
		const sound = new Audio.Sound();

		return {
			sound,
			playback: await sound.loadAsync({ uri }),
		};
	}

	/**
	 * Play a media file
	 * Warning: Can be source of many issues depending of media format.
	 *
	 * @param name
	 * @param url
	 * @param group
	 * @param status
	 *
	 * @returns Promise
	 */
	static async play(name, url, group = 'default', status = {}) {
		return Offline.hasFile(name).then(async ({exists, uri}) => {
			try {
				return await Audio.Sound.createAsync(
					{ uri: exists ? uri : url },
					{ shouldPlay: true, ...status },
				).then((res) => {
					res.completed = false;
					res.sound.setOnPlaybackStatusUpdate((status) => {
						if (!status.didJustFinish) {
							return;
						}
						res.sound.unloadAsync().then(() => {
							res.completed = true;
						}).catch((err) => console.log('unload.error', err));
					});
					return res;
				}).catch((error) => {
					switch (error.code) {
						case 'ABI37_0_0EXAV': // Corrupted memory.. try to recreate and read from remote URL meanwhile..
							return Offline.cacheFile(name, url, true).then(uri => {
								return Audio.Sound.createAsync(
									{ uri: url },
									{ shouldPlay: true },
								).catch(err => console.log(err, url));
							}).catch(err => console.log(err, url));
							break;
						default:
							console.log(error);
							break;
					}
				});
			} catch(e) {
				return new Promise((resolve, reject) => {
					reject(e);
				});
			}
		});
	}

	/**
	 * Generate silence in milliseconds
	 *
	 * @param milliseconds
	 * @returns {string}
	 */
	static generateBase64Silence(milliseconds) {

		let silence = '';
		const reversedDuration = milliseconds.toString().split("").reverse().map(str => parseInt(str));
		reversedDuration.forEach((amount, idx) => {
			silence += silences[idx].repeat(amount);
		});

		return silence;
	}
}
